import React, { useState, useEffect, useRef } from "react";
import { Modal } from "bootstrap";
import './Dashboard.css';
import FirebaseCon from "../firebase/FirebaseCon";

function setLocalStorage() {
    localStorage.setItem(RecipientName, PhoneNumber);
    localStorage.setItem(DateTime, value);
    localStorage.setItem(key, value);
    localStorage.setItem(key, value);
    localStorage.setItem(key, value);
}


function PopForm() {
    const [modal, setModal] = useState(null);
    const exampleModal = useRef();

    useEffect(() => {
        setModal(new Modal(exampleModal.current))
    }, []);


        // RecipientName: '',
        // PhoneNumber: '',
        // DateTime: '',
        // ShippingCompany: '',
        // ShippmentNumber: '',


    setLocalStorage(details, 'test2')

    return (
        <>

            <button
                type="button"
                className="btn btn-primary"
                onClick={() => modal.show()} >Add</button>
            <div className="modal modal-lg fade" id="exampleModal" ref={exampleModal} tabindex="-1" aria-labelledby="exampleModalLabel" aria-hidden="true">
                <div className="modal-dialog">
                    <div className="modal-content">
                        <div className="modal-header">
                            <h1 className="modal-title fs-5" id="exampleModalLabel">New Shippment</h1>
                            <button type="button" className="btn-close" data-bs-dismiss="modal" aria-label="Close"></button>
                        </div>
                        <form>
                            <div className="modal-body">

                                <div className="row">
                                    <div className="col-md-6">
                                        <label for="exampleFormControlInput1" className="form-label">Name</label>
                                        <input type="text" className="form-control" id="exampleFormControlInput1" placeholder="Abdullah" required onChange={(e) =>
                                            setDetails({ ...details, RecipientName: e.target.value })} />
                                    </div>
                                    <div class="col-md-6">
                                        <label for="exampleFormControlInput1" className="form-label">Phone Number</label>
                                        <input type="number" className="form-control " id="exampleFormControlInput1" placeholder="0576717982" maxLength='10' required onChange={(e) =>
                                            setDetails({ ...details, PhoneNumber: e.target.value })} />
                                    </div>
                                </div>
                                <div className="row">
                                    <div className="col-md-6">
                                        <label for="exampleFormControlInput1" className="form-label">Shipping Company</label>
                                        <select className="form-select" aria-label="Default select example">
                                            <option selected>Open this select menu</option>
                                            <option value="1">One</option>
                                            <option value="2">Two</option>
                                            <option value="3">Three</option>
                                        </select>
                                    </div>
                                    <div className="col-md-6">
                                        <label for="exampleFormControlInput1" className="form-label">Scan Number</label>
                                        <input type="number" className="form-control is-valid" id="exampleFormControlInput1" placeholder="1256166512315" required onChange={(e) =>
                                            setDetails({ ...details, ShippmentNumber: e.target.value })} />
                                    </div>
                                </div>


                            </div>
                            <div className="modal-footer">
                                <button type="button" className="btn btn-secondary" data-bs-dismiss="modal">Close</button>
                                <button type="submit" className="btn btn-primary">Send message</button>
                            </div>
                        </form>
                    </div>
                </div>
            </div>
        </>
    )
}

export default PopForm;
